import React, { useState } from "react";
import { useEffect } from "react";
import axios from "axios";

const url = "http://localhost:8080"

export const App = () =>{
    const [str , setStr] = useState('');

    useEffect(()=>{
        axios.get(url + "/user").then(
            (res)=>{
                setStr(res.data)
                console.log(res.data)
            }
        ).catch((err)=>
        console.log(err))
    })

    const findUser = () =>{
        axios.get(url + "/user/find").then(
            (res)=>{
                console.log(res)
            }
        ).catch((err)=>{
            console.log(err);
        })
    }

    return(
        
        <React.Fragment>
            <h1>hello world</h1>
            <h2>퍽킹 로그인 페이지</h2>
            <h3>{str}</h3>
            <button onClick={findUser}>버튼</button>
        </React.Fragment>
    )
}
